import React from "react";

function BackgroundContainer({ height }) {
  return (
    <div
      style={{
        position: relative,
        backgroundColor: "#F8FAF7",
        borderRadius: "20px 20px 0px 0px",
      }}
    ></div>
  );
}

export default BackgroundContainer;
